import React from 'react';
import './MainPage.css';

const MainPage = () => {
  return (
    <div className="main-container">
      <header className="hero-section">
        <h1 className="hero-title">Welcome to <span className="highlight">SUtore</span></h1>
        <p className="hero-subtitle">A technology store for Sabanci students!</p>
        <button className="hero-button">Let's start shopping!</button>
      </header>

      <footer className="footer">
        <p>&copy; 2024 SUtore. All rights reserved.</p>
      </footer>
    </div>
  );
};

export default MainPage;
